import Navbar from 'react-bootstrap/Navbar'

import './topbar.css'

const TopBar = () => {
  return <div className='navBarContainer'>
    <Navbar>
      <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
    </Navbar>
  </div>;
}

export { TopBar };
